import React, { useState } from "react";

export default function Tabs(props) {
  const [activeTab, setActiveTab] = useState(1);

  function handleTabChange(e) {
    setActiveTab(e.target.name);
  }

  return (
    <div class="tab">
      <button class={activeTab===1 ? "active tablinks" : "tablinks"} name="1" onclick={handleTabChange}>
        Art 1
      </button>
      <button class={activeTab===1 ? "active tablinks" : "tablinks"} name="2" onclick={handleTabChange}>
        Art 2
      </button>
      <button class="tablinks" name="3" onclick={handleTabChange}>
        Art 3
      </button>
      <button class="tablinks" name="4" onclick={handleTabChange}>
        Art 4
      </button>
    </div>
  );
}
